import Accordion from "react-bootstrap/Accordion";

export default function Accord(props) {
  return (
    <Accordion>
      <Accordion.Item eventKey="0">
        <Accordion.Header>{props}</Accordion.Header>
        <Accordion.Body>moiz2</Accordion.Body>
      </Accordion.Item>
    </Accordion>
  );
}
